import React, { useEffect } from "react";
import TableBody from "./TableBody";
import TableHead from "./TableHead";

const Table = ({ columns, cells }) => {
   return (
      <table>
         <TableHead columns={columns} />
         <TableBody cells={cells} />
      </table>
   );
};

export default Table;
